import React, { Component } from 'react';
import { Helmet } from 'react-helmet'
import DisplayCards from './components/display-cards/display-cards.js';
import Footer from './components/footer/footer.js';
import Hero from './components/hero/hero.js';
import MobileNavbar from './components/mobile-navbar/mobile-navbar.js';
import Navbar from './components/navbar/navbar.js';

import './App.css';


class App extends Component {
  render() {
    return (
      <div>
        <Helmet>
          <title>Here's the Title!</title>
          <meta name="description" content="This is what you want to show as the page content in the Google SERP Listing" />
        </Helmet>
        <Navbar />
        <MobileNavbar />
        <Hero />
        <div className="card-container">
          <DisplayCards />
        </div>
        <Footer />
      </div>
    );
  }
}

export default App;
